import React from "react"
import {Collapse} from "reactstrap";

class Output extends React.Component{
    componentDidMount(){
        this.props.outputref=React.createRef();
    }
    render(){
        const time=<span><h3>CPU Time: 1234566</h3></span>
        const memory=<span><h3>Memory:1234</h3></span>
        return(
            <Collapse isOpen={this.props.isoutput} >
                <div className="outputbox" style={{marginBottom:"20px"}}>
                    <div className="header">
                        <h4 style={{fontWeight:"300"}}>Output</h4>
                    </div>
                    <textarea className="outputarea" style={{height:"80px",maxHeight:"230px"}}>

                    </textarea>
                </div>
            </Collapse>
        );
    }
}
export default Output;
